import React, { Component } from "react";

export default class Body extends Component {
  render() {
    const style1 = {
      marginTop: "100px",
      height: "300px"
    };
    const style = {
      marginTop: "0px",
      height: "300px"
    };

    const fiftyFifty = {
      width: '50%',
      marginTop: "0px",
      height: "300px"
    }
    const fifteen = {
      width: '15%',
      marginTop: "0px",
      height: "300px"
    }

    const seventy = {
      marginTop: "100px",
      width: '70%',
      marginTop: "0px",
      height: "300px"
    }

    return (
      <div className="body resize">
        <img
          alt="Mother of all Lies"
          style={fifteen}
          src={require("../images/mother.png")}
        />
        <img
          className="resize"
          alt="Blue Hour"
          style={fifteen}
          src={require("../images/bluehour.png")}
        />
        <img
          className="resize"
          alt="Curse of Oak Island"
          style={seventy}
          src={require("../images/curse.png")}
        />
        <img
          className="resize"
          alt="Pitbulls and Parolees"
          style={style}
          src={require("../images/pitbulls.png")}
        />
        <img
          className="resize"
          alt="Killer Kids"
          style={style}
          src={require("../images/killerKids.png")}
        />
        <img
          className="resize"
          alt="Night Watch"
          style={style}
          src={require("../images/nightwatch.png")}
        />
        <img
          className="resize"
          alt="All Summer in a Day"
          style={fiftyFifty}
          src={require("../images/allSummer.png")}
        />
        <img
          className="resize"
          alt="Winter Chemistry"
          style={fiftyFifty}
          src={require("../images/winter.png")}
        />
      </div>
    );
  }
}
